import React from "react";
import { IoSchoolSharp } from "react-icons/io5";

const Nav = () => {
  const menuItems = [
    {
      title: "Home",
      link: "#",
      className: "",
    },
    {
      title: "Home",
      link: "#",
      className: "",
    },
    {
      title: "Home",
      link: "#",
      className: "",
    },
    {
      title: "Home",
      link: "#",
      className: "",
    },
    {
      title: "Home",
      link: "#",
      className: "",
    },
  ];
  return (
    <div>
      <nav className="NavbarItems">
        <h1 className=" flex text-2xl font-semibold text-purple-700">
          <span></span>
          Student Portal
        </h1>
        <div className="MenuIcon"></div>
        <div className="">
          <ul className="flex">
            {menuItems.map((item, index) => {
              return (
                <li key={index}>
                  {" "}
                  <a className={item.className} href={item.link}>
                    {item.title}
                  </a>
                </li>
              );
            })}
          </ul>
        </div>
      </nav>
    </div>
  );
};

export default Nav;
